Sprzedam Opla Zafirę A 1,6 benzyna + gaz z 2003 r. (po lifcie).



Zalety samochody:

- sekwencyjna instalacja gazowa założona w 2019 r., po zakupie samochodu, przy przebiegu 179,5 tys. km;

- auto dobrze wyposażone: 7 foteli, tempomat, klimatyzacja - klimatronik, wspomaganie kierownicy, przciemniane szyby, immobilajzer, 4 x poduszka powietrzna, 2 x elektryczne szyby (z przodu) i inne;

-  stosunkowo niskie zużycie gazu jak na tak duży samochód - zużycie gazu średnio ok. 9l/100 km;

- samochód sprawny, w codziennym użytkowaniu;

- auto było na bieżąco serwisowane - co roku był wymieniany olej, robione przeglądy instalacji gazowej oraz bieżące naprawy;

- ostatnio wymieniony rozrząd, w tym roku zmieniono olej oraz wykonano przegląd instalacji LPG;

- pojazd bardzo przestronny i uniwersalny - można wyjechać z domu mini busem (w 7 osób), a wrócić dostawczakiem - po złożeniu trzeciego rzędu foteli i przesunięciu drugiego rzędu można wozić naprawdę duże przedmioty (pralki, szafki, itp), dodatkowo samochód ma relingi dachowe i łatwo zamontować na nich bagażnik dachowy;

Przegląd techniczny ważny do 19.02.2026, OC, NNW i Assistance do 24.08.2025 r.



Słabe strony pojazdu:

-  samochód ma swoje lata, co widać na zdjęciach: drobne wgniecenia i uszkodzenia karoserii, łuszcząca się folia zabezpieczająca lakier, miejscowe ogniska korozji, ale generalnie nie jest żle - zdrowa podłoga i progi;

- zużycie oleju, jak u Opli - dolewam olej między rocznymi wymianami średnio 2-3 razy, głównie przed dalszym wyjazdem.



Serdecznie zapraszam zainteresowane osoby do obejrzenia samochodu i zakupu. Dla zdecydowanych Nabywców mogę dołożyć w ramach negocjacji drugi komplet kół zimowych na stalowych felgach (oba komplety opon R15 w bardzo dobrym stanie - zostały kupione, po zakupie samochodu w 2019 r.).



Proszę o kontakt telefoniczny - słabo odpisuję na wiadomości OLX:

6x6x6x0x9x2x5x0x5



NR VIN: W_0_L_0_T_G_F_7_5_3_2_1_6_9_4_5_6

Nr rej. WG0310G

Data pierwszej rejestracji: 23.04.2003

Sprzedam Mini One 1.6 benzyna 2002r

W idealnym stanie, zarówno wizualnie, jak i technicznie. W zeszłym roku poprawione zostały elementy nadwozia, na których odpryskiwał lakier – wszystko wykonane profesjonalnie, bez żadnych śladów i niedoróbek.



Specyfikacja i modyfikacje:

	•	Bardzo szybki, a przy tym oszczędny – jeździ znacznie dynamiczniej niż standardowy 1.6, a jednocześnie ma niski poziom spalania;

	•	Sportowe fotele Sparco – wygodne i stylowe;

	•	Oryginalna kierownica Sparco – wysokiej jakości, świetna w prowadzeniu;

	•	Sportowy układ 

(Cooper S)wydechowy – piękny dźwięk i lepsza dynamika;

	•	Cała elektryka w pełni sprawna – wszystko działa bez zarzutu;

	•	System audio z subwooferem – doskonała jakość dźwięku;

	•	Oryginalny przebieg – 144 000 km;

	•	Niedawno wymienione wszystkie oleje i filtry – gotowy do jazdy, bez dodatkowych kosztów.



Dodatkowo:

	•	Komplet opon letnich na oryginalnych felgach Mini Cooper S



Nie sprzedawalibyśmy go, ale czas na coś nowszego. Nowy właściciel będzie bardzo zadowolony – samochód jest w pełni sprawny i gotowy do jazdy, a prowadzenie go to czysta przyjemność!
